INSERT INTO `mod_pages` (`p_id`, `p_title`, `p_subtitle`, `p_slug`, `p_summary`, `p_content`, `p_images`, `p_created_date`, `p_modified_date`, `p_status`) VALUES
(8, 'Pendanaan', 'Kenapa banyak yang pilot mendanai via BKDana?', 'pendanaan', '', '&lt;h2&gt;Kenapa banyak yang pilih mendanai&amp;nbsp;lewat&amp;nbsp;BKDana?&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;h3&gt;Proses Mudah&lt;/h3&gt;Proses registrasi sangat mudah dan untuk mulai mendanai&amp;nbsp;cukup dengan Rp. 100.000,-&lt;/li&gt;&lt;li&gt;&lt;h3&gt;Dana Aman&lt;/h3&gt;BKDana diawasi OJK, bekerjasama dengan asuransi kredit &amp;amp; Penerima Pinjaman&amp;nbsp;yang telah diverifikasi.&lt;/li&gt;&lt;li&gt;&lt;h3&gt;Bunga 12 &amp;ndash; 18%&lt;/h3&gt;Pendapatan bunga&amp;nbsp;dari pendanaan pinjaman jauh diatas bunga deposito dan besarnya tergantung sektor dan rating Penerima Peminjam.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br /&gt;&lt;a class=&quot;btn btn-blue&quot; href=&quot;https://bkdana.id/register-pendana&quot;&gt;Daftar&lt;/a&gt;&lt;/p&gt;', 'borrower.jpg', '2018-06-26 21:19:34', '2018-09-25 03:10:20', '1'),
(9, 'Pinjaman', 'Mengapa Meminjam melalui BKDana?', 'pinjaman', '', '&lt;h2&gt;Mengapa Meminjam melalui BKDana?&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;h3&gt;Mudah&lt;/h3&gt;Pengajuan pinjaman dilakukan secara online dimana saja, darimana saja.&lt;/li&gt;&lt;li&gt;&lt;h3&gt;Cepat&lt;/h3&gt;Proses pencairan dilakukan secara cepat.&lt;/li&gt;&lt;li&gt;&lt;h3&gt;Tanpa Jaminan&lt;/h3&gt;Tidak diperlukan jaminan hanya proses verifikasi terhadap calon peminjam.&lt;/li&gt;&lt;li&gt;&lt;h3&gt;Ringan&lt;/h3&gt;Cicilan terasa ringan dengan suku bunga yang kompetitif.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;a class=&quot;btn btn-blue&quot; href=&quot;https://bkdana.id/register-pinjaman-kilat&quot;&gt;Daftar&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;h2&gt;Produk Pinjaman&lt;/h2&gt;&lt;ol&gt;&lt;li&gt;&lt;h3&gt;BKDana Kilat&lt;/h3&gt;Untuk pengajuan pinjaman personal dengan proses super cepat&lt;/li&gt;&lt;li&gt;&lt;h3&gt;BKDana Mikro&lt;/h3&gt;Untuk pengajuan pinjaman dengan jumlah kurang dari 50 juta rupiah&lt;/li&gt;&lt;/ol&gt;', 'borrower.jpg', '2018-06-26 21:42:12', '2018-09-25 03:11:40', '1'),
(10, 'Tentang Kami', 'Profil BKDana secara umum', 'tentang-kami', '', '&lt;h2&gt;Profil Perusahaan&lt;/h2&gt;&lt;p&gt;PT BERKAH KELOLA DANA adalah perusahaan keuangan pinjam meminjam berbasis teknologi,&amp;nbsp;yang menyediakan paltform pendanaan gotong royong&amp;nbsp;atau peer to peer lending yang mengkhususkan diri untuk mempertemukan pemilik dana (lender) dengan Usaha Mikro, Kecil dan Menengah (borrower) yang membutuhkan tambahan permodalan untuk mengembangkan usahanya&lt;/p&gt;&lt;p&gt;Platform kami berbasis web dan mobile apps yang bisa diakses oleh&amp;nbsp;global lender (dalam dan luar negeri), dan&amp;nbsp;akan membantu permodalan bagi&amp;nbsp;Usaha Mikro, Kecil dan Menengah (UMKM) di seluruh wilayan Indonesia.&lt;/p&gt;&lt;p&gt;Adapun fokus utama kami untuk pembiayaan sektor pertanian dan retail, yang sklala usahanya saai ini kurang mendapat akses permodalan dari Lembaga Perbankan.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Alamat Kantor BKD :&lt;br /&gt;BKD BUILDING&lt;br /&gt;Jl. Guntur 45 Setiabudi Kuningan&lt;br /&gt;Jakarta Selatan 12980&lt;br /&gt;Telp. +62 21 83784354 - 55&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;h2&gt;&lt;strong&gt;&lt;span style=&quot;font-size:24px&quot;&gt;Visi dan Misi&lt;/span&gt;&lt;/strong&gt;&lt;/h2&gt;&lt;h3&gt;&lt;span style=&quot;font-size:24px&quot;&gt;Visi&lt;/span&gt;&lt;/h3&gt;&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;Menjadi fintech lending pilihan pertama dan terpercaya&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;span style=&quot;font-size:24px&quot;&gt;Misi&lt;/span&gt;&lt;/h3&gt;&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;Menyediakan platform terbaik kepada pemberi dan penerima pinjaman, serta kemudahan layanan keuangan bagi masyarakat yang belum memiliki akses ke lembaga perbankan&lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;span style=&quot;font-size:24px&quot;&gt;Tim Perusahaan&lt;/span&gt;&lt;/h3&gt;&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;BKDana didirikan dan dikelola oleh tim professional yang siap membantu dan melayani Anda dalam melakukan transaksi&amp;nbsp; P2P Lending.&lt;/span&gt;&lt;/p&gt;', '44.jpg', '2018-06-29 09:17:57', '2018-07-25 13:30:38', '1'),
(11, 'Bantuan', 'Pertanyaan yang sering ditanyakan secara umum', 'bantuan', '', '&lt;div class=&quot;description&quot;&gt;                            &lt;br&gt;&lt;br&gt;                            &lt;!-- Nav tabs --&gt;                            &lt;ul class=&quot;nav nav-tabs&quot; role=&quot;tablist&quot;&gt;                                &lt;li role=&quot;presentation&quot; class=&quot;active&quot;&gt;                                    &lt;a href=&quot;#pendanaan&quot; aria-controls=&quot;pendanaan&quot; role=&quot;tab&quot; data-toggle=&quot;tab&quot;&gt;Pendanaan (Investasi)&lt;/a&gt;                                &lt;/li&gt;                                &lt;li role=&quot;presentation&quot; class=&quot;&quot;&gt;                                    &lt;a href=&quot;#pinjaman&quot; aria-controls=&quot;pinjaman&quot; role=&quot;tab&quot; data-toggle=&quot;tab&quot;&gt;Pinjaman&lt;/a&gt;                                &lt;/li&gt;                                &lt;li role=&quot;presentation&quot; class=&quot;&quot;&gt;                                    &lt;a href=&quot;#pinjaman-kilat&quot; aria-controls=&quot;pinjaman-kilat&quot; role=&quot;tab&quot; data-toggle=&quot;tab&quot;&gt;BKDana Kilat&lt;/a&gt;                                &lt;/li&gt;                                &lt;li role=&quot;presentation&quot;&gt;                                    &lt;a href=&quot;#pinjaman-mikro&quot; aria-controls=&quot;pinjaman-mikro&quot; role=&quot;tab&quot; data-toggle=&quot;tab&quot;&gt;BKDana Mikro&lt;/a&gt;                                &lt;/li&gt;                            &lt;/ul&gt;                            &lt;div class=&quot;tab-content&quot;&gt;                                &lt;div role=&quot;tabpanel&quot; class=&quot;tab-pane fade active in&quot; id=&quot;pendanaan&quot;&gt;                                    &lt;br&gt;                                    &lt;h2&gt;FAQ Pendanaan (Investasi)&lt;/h2&gt;                                    &lt;ol&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apa itu Pendanaan (investasi) BKDana?&lt;/h3&gt;                                            Adalah penanaman modal dengan memberikan pinjaman kepada peminjam dengan                                            tingkat suku bunga dan tenor yang ditetapkan                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Siapa yang bisa melakukan pendanaan di BKDana?&lt;/h3&gt;                                            Siapa saja yang telah melakukan pendaftaran dan melengkapi dokumen indentitas                                            yang benar.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana cara berinvestasi di BKDana?&lt;/h3&gt;                                            Pemberi pinjaman harus melakukan pendaftaran dengan mengisi formulir dan                                            melengkapi dokumen yang dilanjutkan dengan mengisi saldo rekening sesuai jumlah                                            yang akan diinvestasikan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana cara isi atau tambah saldo?&lt;/h3&gt;                                            Pemberi pinjaman yang telah terdaftar akan memiliki rekening virtual yang dapat diisi                                            saldonya dengan melakukan transfer dari Bank mana saja.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana cara saya berinvestasi?&lt;/h3&gt;                                            Cukup pilih produk pinjaman dan daftar peminjam baik itu perorangan atau badan usaha                                            dengan tingkat suku bunga yang ditetapkan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apa saja keuntungan yang didapat dengan berinvestasi di BKDana?&lt;/h3&gt;                                            Selain mudah dan aman, dana dapat tumbuh berkembang dengan tingkat suku bunga                                            diatas deposito.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Berapa jumlah dana minimal yang dapat saya investasikan?&lt;/h3&gt;                                            Dana minimal yang dapat diinvestasikan adalah Rp 100.000.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Berapa keuntungan yang didapat oleh pemberi pinjaman?&lt;/h3&gt;                                            Keuntungan yang didapat oleh Pemberi Pinjaman disesuaikan dengan produk pinjaman                                            yang dipilih.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Kapan keuntungan diperoleh Pemberi Pinjaman?&lt;/h3&gt;                                            Pemberi pinjaman akan menerima secara langsung di rekening atas pembayaran                                            angsuran dari peminjam sesuai tenor dan produk pinjaman yang dipilih.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana cara pencairan dana hasil investasi?&lt;/h3&gt;                                            Dana yang ada di rekening dapat dicairkan kapan saja sesuai keinginan dengan cara                                            ditransfer ke Rekening Bank yang didaftarkan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apakah aman berinvestasi melalui BKDana?&lt;/h3&gt;                                            Investasi di BKDana aman karena BKDana akan melakukan verifikasi dan analisa                                            terhadap seluruh calon Peminjam dengan menggunakan sistem credit scoring dan                                            sistem keamanan jaringan digital serta bekerjasama dengan asosiasi teknologi                                            keuangan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apakah Pemberi pinjaman dapat mengetahui informasi tentang peminjam?&lt;/h3&gt;                                            Sesuai peraturan OJK, BKDana hanya akan memberikan data profil peminjam sebatas                                            informasi demografis dan finansial.                                        &lt;/li&gt;                                    &lt;/ol&gt;                                &lt;/div&gt;                                &lt;div role=&quot;tabpanel&quot; class=&quot;tab-pane fade&quot; id=&quot;pinjaman&quot;&gt;                                    &lt;br&gt;                                    &lt;h2&gt;FAQ Pinjaman&lt;/h2&gt;                                    &lt;ol&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apakah Pinjaman di BKDana?&lt;/h3&gt;                                            Adalah proses mengajukan pinjaman dana melalui sistem peer to peer.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Siapa saja yang bisa mengajukan pinjaman?&lt;/h3&gt;                                            Warga negara Indonesia berusia 17 tahun dengan memiliki indentitas diri                                            berupa KTP dan memiliki NPWP.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana cara mengajukan pinjaman?&lt;/h3&gt;                                            Penerima pinjaman harus melakukan pendaftaran dengan mengisi formulir                                            pengajuan pinjaman dan melengkapi dokumen yang diperlukan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana saya menerima dana pinjaman?&lt;/h3&gt;                                            Setelah proses pengajuan dana pinjaman lolos verifikasi dan memperoleh                                            pendanaan, maka dana akan di transfer ke rekening yang didaftarkan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana cara membayar angsuran?&lt;/h3&gt;                                            Penerima pinjaman dapat mengangsur pinjaman sesuai jumlah angsuran yang                                            telah ditetapkan dengan cara melakukan transfer ke rekening yang ditentukan kepada                                            peminjam.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apakah setelah lunas saya bisa mengajukan pinjaman kembali?&lt;/h3&gt;                                            Ya, bisa. Apabila pinjaman sebelumnya telah lunas dan tidak                                            pernah terlambat dalam membayar angsuran sesuai jadwal yang                                            telah ditentukan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana Prosedur untuk pengajuan kembali?&lt;/h3&gt;                                            Apabila anda ingin mengajukan pinjaman kembali setelah pinjaman                                            sebelumnya telah lunas, anda cukup tekan menu pinjaman kembali (Re-Loan) dan                                            melampirkan dokumen tambahan bila ada yang perlu diganti atau dirubah dokumennya.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana jika tidak dapat memenuhi kewajiban pembayaran?&lt;/h3&gt;                                            Apabila peminjam sudah tidak bisa memenuhi kewajiban membayar angsuran, maka                                            status pinjaman menjadi beresiko Gagal Bayar. Peminjam akan masuk dalam                                            daftar hitam peminjam (Black List) dan akan dilaporkan ke regulator                                            keuangan di Indonesia (OJK dan BI) sebagai debitur bermasalah.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Berapa tingkat suku bunga pinjaman?&lt;/h3&gt;                                            Tingkat suku bunga pinjaman sangat tergantung dari produk pinjaman dan sektor                                            usaha peminjam.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apakah yang bisa mengajukan pinjaman hanya di wilayah Jabotabek?&lt;/h3&gt;                                            Tidak. Semua warga negara Indonesia yang tinggal diwilayah Negara Republik                                            Indonesia dapat mengajukan pinjaman.                                        &lt;/li&gt;                                    &lt;/ol&gt;                                &lt;/div&gt;                                &lt;div role=&quot;tabpanel&quot; class=&quot;tab-pane fade&quot; id=&quot;pinjaman-kilat&quot;&gt;                                    &lt;br&gt;                                    &lt;h2&gt;FAQ BKDana Kilat&lt;/h2&gt;                                    &lt;ol&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apakah BKDana Kilat itu?&lt;/h3&gt;                                            Dana Kilat adalah Pinjaman dana tunai yang diperuntukkan khusus untuk                                            personal yang membutuhkan dana talangan untuk kebutuhan mendadak.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apakah BKDana Kilat memerlukankan Jaminan?&lt;/h3&gt;                                            Dana Kilat tidak memerlukan Jaminan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apa syarat untuk mendapatkan pinjaman BKDana Kilat?&lt;/h3&gt;                                            Syarat untuk mendapatkan Pinjaman DanaKilat adalah:&lt;br&gt;                                            1. Foto KTP&lt;br&gt;                                            2. Swafoto atau Selfie dengan memperlihatkan KTP&lt;br&gt;                                            3. Foto Slip Gaji Bulan Terakhir (untuk Karyawan)&lt;br&gt;                                            4. Foto Kartu Mahasiswa (untuk Mahasiswa)&lt;br&gt;                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Berapa jumlah Pinjaman yang dapat diajukan?&lt;/h3&gt;                                            Jumlah Dana Pinjaman yang dapat diajukan adalah Rp 1 juta s/d Rp. 2 juta.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana cara proses mengajukan Pinjaman BKDana Kilat?&lt;/h3&gt;                                            1. Melakukan pendaftaran sebagai Peminjam dengan mengisi Formulir dan                                            melengkapi dokumen yang benar.&lt;br&gt;                                            2. Akan dilakukan verifikasi terhadap data-data yang diberikan saat                                            pendaftaran.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Berapa lama proses pengajuan pinjaman BKDana Kilat?&lt;/h3&gt;                                            Proses pengajuan pinjaman BKDana Kilat memerlukan waktu hanya 15 menit.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Berapa lama masa pinjaman?&lt;/h3&gt;                                            Masa Pinjaman 7 hari atau 14 hari.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Kapan Pinjaman dibayar/ dilunasi?&lt;/h3&gt;                                            Pinjaman dibayar atau dilunasi pada saat jatuh tempo pinjaman.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apakah ada biaya yang dikenakan?&lt;/h3&gt;                                            Ada biaya administrasi dan bunga yang akan dipotong pada saat pencairan                                            dana pinjaman.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Berapakah besaran biaya dan bunga yang dikenakan?&lt;/h3&gt;                                            Biaya Administrasi dan bunga dapat dilihat di tabel kalkulasi pada saat                                            pengajuan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Adakah biaya yang dikenakan jika membayar melewati tanggal jatuh tempo?&lt;/h3&gt;                                            Apabila melakukan pembayaran atau pelunasan setelah                                            melewati tanggal jatuh tempo, akan dikenakan biaya denda sebesar 1%                                            per hari dari jumlah pinjaman.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana cara membayar pinjaman?&lt;/h3&gt;                                            Pembayaran pinjaman dapat dilakukan dengan cara transfer melalui Bank ke                                            rekening yang telah ditentukan.                                        &lt;/li&gt;                                    &lt;/ol&gt;                                &lt;/div&gt;                                &lt;div role=&quot;tabpanel&quot; class=&quot;tab-pane fade&quot; id=&quot;pinjaman-mikro&quot;&gt;                                    &lt;br&gt;                                    &lt;h2&gt;FAQ BKDana Mikro&lt;/h2&gt;                                    &lt;ol&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apakah Pinjaman BKDana Mikro itu?&lt;/h3&gt;                                            Pinjaman BKDana Mikro adalah Pinjaman yang diberikan bagi para pelaku                                            usaha Mikro.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apa syarat untuk mendapatkan Pinjaman Dana Mikro?&lt;/h3&gt;                                            Syarat untuk mendapatkan pinjaman BKDana Mikro adalah pelaku usaha                                            mikro yang memiliki usaha dengan dilengkapi Surat Keterangan Usaha                                            yang dikeluarkan oleh Kantor Kelurahan setempat.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana cara saya mendapat kan pinjaman?&lt;/h3&gt;                                            1. Melakukan pendaftaran sebagai Peminjam dengan mengisi Formulir                                            dan melengkapi dokumen yang benar.&lt;br&gt;                                            2. Akan dilakukan verifikasi terhadap data-data yang diberikan saat                                            pendaftaran.&lt;br&gt;                                            3. Membentuk kelompok atau Group Peminjam                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apa yang dimaksud dengan Group?&lt;/h3&gt;                                            Group adalah kelompok dari anggota peminjam yang terdiri dari 5 s/d 10                                            peminjam. Kelompok atau Group tersebut harus memiliki Kepengurusan berupa                                            Ketua, Wakil Ketua dan Bendahara. Para anggota bersedia untuk hadir                                            dalam pertemuan Kelompok dan sepakat dengan konsep tanggung                                            renteng apabila ada anggota yang gagal bayar.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana saya dapat uang pinjaman saya?&lt;/h3&gt;                                            Setelah data lengkap dan diajukan dan disetujui, maka akan disebar ke                                            pemberi pinjaman untuk penggalangan dana dan setelah memperoleh                                            sejumlah dana yang diajukan akan dilakukan pencairan dengan transfer                                            langsung ke rekening peminjam.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Berapa Plafon pinjaman yang bisa saya ajukan?&lt;/h3&gt;                                            Plafon pinjaman bisa sampai Rp 50 Juta tergantung analisa usaha Anda.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana cara melakukan pembayaran Pinjaman?&lt;/h3&gt;                                            Pembayaran Angsuran pinjaman dapat dilakukan dengan cara transfer                                            ke rekening melalui ATM dan setor tunai melalui Alfa atau Indomaret                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana jika terlambat membayar Angsuran?&lt;/h3&gt;                                            Apabila terlambat membayar angsuran sesuai jadwal maka akan                                            dikenakan biaya keterlambatan sesuai dengan ketentuan yang                                            ditetapkan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Apakah saya bisa mengajukan Pinjaman kembali?&lt;/h3&gt;                                            Ya, bisa. Apabila pinjaman sebelumnya telah dilunasi dan jika tidak                                            pernah terjadi keterlambatan pembayaran angsuran sesuai jadwal                                            yang telah ditentukan.                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana Jika tidak dapat memenuhi kewajiban?&lt;/h3&gt;                                            Apabila ada anggota yang tidak bisa membayar angsuran maka akan menjadi tanggung                                            jawab seluruh anggota Group sesuai kesepakatan tanggung renteng (sesuai No. 4).                                        &lt;/li&gt;                                        &lt;li&gt;                                            &lt;h3&gt;Bagaimana jika Satu Group sudah tidak bisa memenuhi kewajiban membayar pinjaman?&lt;/h3&gt;                                            Apabila satu Group peminjam sudah tidak bisa memenuhi kewajibannya, maka                                            status pinjaman menjadi beresiko Gagal Bayar. Seluruh anggota Group Peminjam akan                                            masuk daftar hitam peminjam (Black List) dan akan dilaporkan ke regulator keuangan di                                            Indonesia (OJK dan BI) sebagai debitur bermasalah.                                        &lt;/li&gt;                                    &lt;/ol&gt;                                &lt;/div&gt;                            &lt;/div&gt;                        &lt;/div&gt;', NULL, '2018-06-26 21:19:34', '2018-07-31 03:26:01', '1'),
(12, 'Syarat &amp; Ketentuan', 'Syarat &amp; Ketentuan penggunaan Platform BKDana', 'syarat-ketentuan', '', '&lt;p&gt;Terima kasih telah mengunjungi www.BKDana.id Sebelum menggunakan, mengakses atau memanfaatkan Platform ini, pastikan Anda sudah membaca dengan baik seluruh Syarat dan Ketentuan Umum ini.&lt;/p&gt;&lt;p&gt;Syarat dan Ketentuan Umum ini berisi mengenai aturan, pedoman, panduan, pemberitahuan, kebijakan dan instruksi yang berkaitan dengan penggunaan Platform beserta Layanan yang terdapat dalam Platform. Dengan tetap mengakses dan menggunakan Platform ini Anda menyatakan bahwa Anda telah membaca, memahami dan menyetujui setiap dan seluruh isi Syarat dan Ketentuan Umum ini.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;1. Definisi&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Istilah-istilah dalam Syarat dan Ketentuan di bawah ini akan memiliki arti sebagai berikut:&lt;/p&gt;&lt;ol style=&quot;list-style-type:lower-alpha&quot;&gt;&lt;li&gt;PT BERKAH KELOLA DANA adalah&amp;nbsp;&amp;nbsp;suatu perusahaan yang menyediakan Platform untuk melaksanakan kegiatan pinjaman secara peer to peer (peer to peer lending).&lt;/li&gt;&lt;li&gt;Layanan adalah jasa penyediaan ruang yang disediakan oleh Perusahaan pada Platform untuk mempertemukan Kreditur dan Debitur dalam rangka melaksanakan kegiatan pinjaman secara peer to peer (peer to peer lending).&lt;/li&gt;&lt;li&gt;Pemberi Pinjaman adalah Pengguna yang menggunakan Layanan yang bermaksud untuk memberikan Pinjaman melalui Platform.&lt;/li&gt;&lt;li&gt;Penerima Pinjaman adalah setiap Pengguna yang menggunakan Layanan yang bermaksud untuk menerima Pinjaman melalui Platform.&lt;/li&gt;&lt;li&gt;Pengguna atau Anda adalah setiap orang yang mengunjungi, mengakses dan/atau menggunakan Platform.&lt;/li&gt;&lt;li&gt;Data Pribadi adalah identitas pribadi, nomor rekening pada Platform, serta segala data dan informasi sehubungan dengan nilai rekening dan penghasilan yang didapat Pengguna baik sebagai Pemberi Pinjaman maupun Penerima Pinjaman, apabila ada, pada Platform.&lt;/li&gt;&lt;li&gt;Target Pinjaman adalah aplikasi Pinjaman dari Penerima Pinjaman yang ditempatkan di dalam Platform untuk ditawarkan kepada Pemberi Pinjaman.&lt;/li&gt;&lt;li&gt;Klasifikasi Target Pinjaman adalah kategori Target Pinjaman berdasarkan nilai risiko dan bunga.&lt;/li&gt;&lt;li&gt;Pinjaman adalah dana yang diberikan oleh Pemberi Pinjaman untuk ditujukan kepada Penerima Pinjaman melalui Rekening&lt;/li&gt;&lt;li&gt;Platform adalah BKDana.&lt;/li&gt;&lt;li&gt;Rekening BKDana adalah rekening Perusahaan yang difungsikan secara khusus kepada Pemberi Pinjaman dan Penerima Pinjaman dalam rangka penyediaan Layanan.&lt;/li&gt;&lt;li&gt;Perjanjian Kredit adalah perjanjian pinjam meminjam antara Pemberi Pinjaman dan Penerima Pinjaman sehubungan dengan Pinjaman dalam rangka penyediaan Layanan yang diberikan oleh Perusahaan.&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;2. Ketentuan Umum&lt;/p&gt;&lt;p&gt;Dengan mengakses dan menggunakan Platform ini Anda menyatakan bahwa diri Anda telah membaca dan memahami Syarat dan Ketentuan Umum ini.&lt;/p&gt;&lt;p&gt;Dalam hal terdapat pertentangan atau perbedaan penafsiran antara Syarat dan Ketentuan Umum ini dengan Syarat dan Ketentuan/Perjanjian lain, maka yang berlaku adalah Syarat dan Ketentuan/Perjanjian yang berlaku spesifik.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;3. Penggunaan Umum&lt;/p&gt;&lt;p&gt;Platform ini ditujukan untuk digunakan oleh Pengguna individu berusia minimal 17 tahun. Dengan menggunakan Platfom dan/atau memanfaatkan Layanan pada Platform, Anda menyatakan dan menjamin bahwa Anda berusia 17 tahun ke atas dan akan mematuhi seluruh isi Syarat dan Ketentuan Umum ini. Segala bentuk penggunaan Platfom dan Layanan oleh Pengguna berusia di bawah 17 tahun adalah tidak sah dan merupakan pelanggaran terhadap Syarat dan Ketentuan Umum ini sehingga Kami berhak untuk tidak menyediakan Layanan yang Kami sediakan dalam Platform lebih lanjut.&lt;/p&gt;&lt;p&gt;Anda tidak dapat memanfaatkan Platform maupun Layanan untuk keperluan-keperluan yang bertentangan dengan hukum.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;4. Perubahan atas Syarat dan Ketentuan Penggunaan&lt;/p&gt;&lt;p&gt;Perusahaan berhak untuk mengubah Syarat dan Ketentuan Umum atas kebijakannya sendiri dari waktu ke waktu. Segala perubahan atas Syarat dan Ketentuan Umum ini akan berlaku serta merta setelah Perusahaan mencantumkannya pada Platform. Perusahaan akan mencantumkan tanggal perubahan terakhir atas Syarat dan Ketentuan Umum pada halaman depan Platform.&lt;/p&gt;&lt;p&gt;Anda memahami dan menyetujui bahwa ketika Anda melanjutkan penggunaan Platform atau Layanan setelah dilakukan perubahan atas Syarat dan Ketentuan Umum ini menjadikan Anda tunduk dan terikat pada Syarat dan Ketentuan yang baru.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;5. Persetujuan Terhadap Penggunaan Transaksi Elektronik&lt;/p&gt;&lt;p&gt;Dengan menggunakan dan mengakses Platform sebagai Pengguna, Anda memahami dan menyetujui bahwa segala bentuk komunikasi dari Perusahaan berkaitan dengan Layanan kepada Anda melalui Platform akan diberikan secara elektronik baik melalui e-mail atau dipublikasikan melalui Platform.&lt;/p&gt;&lt;p&gt;Anda sepakat untuk menerima seluruh dokumen, pemberitahuan dan perjanjian secara elektronik yang timbul atas penggunaan Platform dan Layanan, termasuk untuk Layanan sebagai Pemberi Pinjaman maupun sebagai Penerima Pinjaman. Segala persetujuan dari Anda terhadap setiap dokumen, pemberitahuan dan perjanjian secara elektronik yang timbul atas penggunaan Platform dan Layanan tersebut diberikan dengan melakukan tanda tangan secara elektronik.&lt;/p&gt;&lt;p&gt;Setiap persetujuan yang telah Anda berikan secara elektronik melalui Platform adalah sepenuhnya tanggung jawab dan mengikat Anda selaku pengguna Layanan, baik hak maupun kewajiban yang timbul atas persetujuan tersebut.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;6. Kebijakan Privasi&lt;/p&gt;&lt;p&gt;Kami menghormati perlindungan atas privasi Anda. Kami tidak mengumpulkan informasi pribadi tentang Anda kecuali Anda secara khusus dan sengaja memilih untuk memberikan informasi tersebut kepada Kami antara lain untuk hal-hal sebagai berikut:&lt;/p&gt;&lt;p&gt;data-data pribadi yang Anda berikan kepada Kami; dan&lt;/p&gt;&lt;p&gt;data-data yang dibutuhkan untuk mengakses akun Anda sebagai Pengguna, termasuk namun tidak terbatas pada IP address, hardware, dll. sejak Anda mengunjungi dan mengakses Platform.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;7. Konten Pengguna pada Platform&lt;/p&gt;&lt;p&gt;Anda bertanggung jawab sepenuhnya atas segala materi dan informasi yang Anda berikan, unggah, publikasikan, sediakan atau tampilkan pada Platfom serta materi dan informasi yang Anda kirimkan atau berikan pada Pengguna lain (&amp;ldquo;Konten Pengguna&amp;rdquo;).&lt;/p&gt;&lt;p&gt;Anda memahami dan menyetujui bahwa Perusahaan berhak, namun tidak berkewajiban, untuk atas kebijakannya sendiri meninjau dan menghapus (tanpa pemberitahuan) segala Konten Pengguna, termasuk namun tidak terbatas pada, Konten Pengguna yang atas kebijakan Perusahaan digolongkan sebagai pelanggaran atas Syarat dan Ketentuan Umum, bertentangan dengan hukum dan peraturan perundang-undangan yang berlaku, atau dapat melanggar atau membahayakan hak dan keamanan Pengguna lain.&lt;/p&gt;&lt;p&gt;Dengan menggunakan Platform ini Anda memberikan hak kepada Perusahaan untuk menggunakan, menyalin, menampilkan secara publik, memformat ulang, dan mendistribusikan Konten Pengguna untuk tujuan lain (pemasaran dan/atau promosi) atau terkait dengan penggunaan Platform. Anda berhak untuk menarik Konten Pengguna Anda setiap saat. Apabila Anda menarik Konten Pengguna Anda dari Platform, segala hak yang telah Anda berikan pada Perusahaan sebagaimana dimaksud di atas tetap berlaku.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;8. Tindakan Yang Dilarang&lt;/p&gt;&lt;p&gt;Anda menyatakan dan menjamin bahwa Anda tidak akan menggunakan dan mengakses Platform, kecuali mendapat persetujuan Perusahaan terlebih dahulu untuk melakukan hal-hal sebagai berikut:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Menggunakan, mengakses, mengumpulkan dan/atau mengambil data pada Platform, baik dengan suatu tujuan secara khusus maupun tanpa tujuan tertentu;&lt;/li&gt;&lt;li&gt;Menggunakan sarana dan/atau program otomatis apapun untuk mengakses Platform dan/atau mengumpulkan informasi dari Platform;&lt;/li&gt;&lt;li&gt;Mengunggah, mempublikasikan, mengirim email dan menyediakan iklan, promosi, junk mail, spam, dan/atau segala bentuk apapun lainnya baik untuk komersial ataupun non-komersial, pada Platform, Pengguna Platform dan/atau pihak ketiga;&lt;/li&gt;&lt;li&gt;Mengubah tampilan Platform;&lt;/li&gt;&lt;li&gt;Membuat pop-up untuk setiap akses terhadap Platform;&lt;/li&gt;&lt;li&gt;Melakukan hal-hal lain yang memiliki dampak terhadap dan dapat merugikan Kami dan fasilitas dalam Platform.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;9. Pengakhiran&lt;/p&gt;&lt;p&gt;Anda sepakat bahwa dalam hal terdapat pelanggaran yang Anda lakukan atas ketentuan dalam Syarat dan Ketentuan ini atau terhadap hukum yang berlaku, maka Perusahaan dapat secara sepihak dan tanpa pemberitahuan terlebih dahulu menghapus Akun Anda pada Platform, membatasi akses Anda pada Platform dan mengakhiri Layanan kepada Anda. Anda sepakat bahwa segala kerugian baik materiil ataupun imateril yang timbul dari penghapusan Akun dan/atau pembatasan akses Anda sebagaimana dimaksud di atas sepenuhnya merupakan tanggung jawab Anda.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;10. Keakuratan Data&lt;/p&gt;&lt;p&gt;Anda sepakat bahwa dengan mengakses Platform dan menggunakan Layanan, Anda menjamin keaslian dan keakuratan data-data yang Anda berikan melalui Platform. Data-data yang Anda berikan adalah data yang benar, akurat, lengkap, terbaru dan tidak menyesatkan.&lt;/p&gt;&lt;p&gt;Anda memahami bahwa Anda memiliki kewajiban untuk selalu:&lt;/p&gt;&lt;ol style=&quot;list-style-type:lower-alpha&quot;&gt;&lt;li&gt;Memperbaharui dan menginformasikan kepada Perusahaan atas setiap data-data yang yang mengalami perubahan, segera setelah perubahan tersebut;&lt;/li&gt;&lt;li&gt;Menjaga password dan data pribadi Anda;&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;Dalam hal Anda bertindak untuk organisasi, asosiasi atau perusahaan, Anda bertanggung jawab penuh atas setiap penggunaan Layanan, termasuk namun tidak terbatas untuk melakukan hal-hal sebagaimana diatur dalam huruf a dan b di atas.&lt;/p&gt;&lt;p&gt;Apabila Perusahaan menemukan, baik langsung maupun di kemudian hari, bahwa data-data atau informasi yang Anda berikan kepada Perusahaan tidak benar, diduga palsu dan/atau tidak akurat, maka Perusahaan berhak untuk memblokir akses Anda terhadap Platform. Anda akan bertanggung jawab penuh terhadap setiap kerusakan yang timbul maupun yang akan timbul, baik materiil maupun immaterial, atas setiap ketidakakuratan data yang Anda berikan.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;11. Laporan Perpajakan&lt;/p&gt;&lt;p&gt;Pengguna memahami bahwa Perusahaan merupakan lembaga keuangan pelapor sehingga tunduk pada ketentuan Peraturan Direktur Jenderal Pajak Nomor PER-04/PJ/2018 serta ketentuan peraturan perundang-undangan lainnya di bidang perpajakan berikut segala peraturan pelaksana maupun amandemen terhadapnya. Anda juga memahami bahwa sebagai lembaga keuangan pelapor, kami wajib melakukan pelaporan pajak sesuai dengan ketentuan tersebut. Oleh karena itu Anda sepakat bahwa Kami dapat melaporkan Data Pribadi Anda menggunakan mekanisme elektronik secara online melalui laman Direktorat Jenderal Pajak atau mekanisme nonelektronik yang dilakukan secara langsung ke Kantor Pelayanan Pajak Pratama atau melalui Otoritas Jasa Keuangan sesuai dengan waktu yang telah ditentukan berdasarkan peraturan tersebut di atas.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;12. Pernyataan dan Jaminan&lt;/p&gt;&lt;p&gt;Perusahaan adalah penyedia Platform yang melakukan kegiatan peer to peer lending dan memberikan jasa konsultasi bisnis kepada pengguna Platform. Dalam hal ini, Pinjaman langsung diberikan oleh Pemberi Pinjaman kepada Penerima Pinjaman, namun difasilitasi oleh Perusahaan sebagai penyedia Platform.&lt;/p&gt;&lt;p&gt;Hubungan pinjam-meminjam antara Kreditur dan Debitur diatur dalam Perjanjian Kredit yang disepakati oleh para pihak.&lt;/p&gt;&lt;p&gt;Pinjaman yang terdapat dalam Platform adalah berdasarkan suatu Perjanjian Kredit dan tidak dapat dianggap sebagai Efek sebagaimana dimaksud dalam Undang-Undang Nomor 8 Tahun 1995 tentang Pasar Modal. Oleh karena itu, penawaran atas Pinjaman yang terdapat dalam Platform juga bukan merupakan suatu Penawaran Umum sebagaimana dimaksud dalam Undang-Undang Nomor 8 Tahun 1995 tentang Pasar Modal, melainkan hanya merupakan penawaran yang bersifat perdata.&lt;/p&gt;&lt;p&gt;Perusahaan tidak melakukan tindakan penghimpunan maupun pengelolaan dana masyarakat, baik itu untuk simpanan ataupun investasi.&lt;/p&gt;&lt;p&gt;Perusahaan tidak memberikan janji, pernyataan dan jaminan mengenai suatu hasil apapun yang dapat diperoleh melalui penggunaan Platform ini. Segala keputusan yang diambil oleh Pengguna dalam menggunakan Layanan dalam Platform sepenuhnya adalah keputusan Pengguna.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;13. Hak Kekayaan Intelektual&lt;/p&gt;&lt;p&gt;Jika Anda merasa hak kekayaan intelektual Anda di dalam Platform dilanggar, mohon melaporkan kepada Perusahaan disertai dengan bukti-bukti yang cukup. Perusahaan akan memeriksa permohonan Anda, dan apabila Perusahaan, atas pertimbangan pribadinya, menganggap bahwa permohonan Anda dapat dipenuhi, Perusahaan akan menghubungi pihak yang dianggap telah melakukan pelanggaran untuk meminta dihentikannya tindakan dimaksud, atau untuk mencabut akses pihak tersebut ke dalam Platform. Keputusan Perusahaan sepenuhnya merupakan kebijakan Perusahaan dan tidak dapat diganggu-gugat.&lt;/p&gt;&lt;p&gt;Anda sepakat jika Perusahaan menganggap tidak ada dasar yang cukup untuk memenuhi permintaan Anda, Anda tidak dapat meminta pertanggungjawaban Perusahaan dan Anda hanya akan meminta pertanggungjawaban langsung kepada pihak yang Anda anggap telah melanggar hak Anda.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;14. Ganti Rugi&lt;/p&gt;&lt;p&gt;Anda sepakat untuk melepaskan, membebaskan dan mengganti kerugian Perusahaan, afiliasinya, pemegang sahamnya, direktur, komisaris, karyawan, subkontraktor, pemasok, agen dari dan atas segala bentuk tuntuan, gugatan, klaim, kerugian, ganti rugi, termasuk biaya konsultan hukum, yang disebabkan oleh pelanggaran Syarat dan Ketentuan Umum ini oleh Anda dan ketentuan lain yang ditetapkan oleh Perusahaan.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;15. Batasan Tanggung Jawab&lt;/p&gt;&lt;p&gt;Sebagai penyedia Platform, tanggung jawab Perusahaan hanya sebatas memfasilitasi kebutuhan dan keluhan antar masing-masing Pengguna (antara Pemberi Pinjaman dengan Penerima Pinjaman). Perusahaan menyediakan fasilitas Customer Service dalam waktu kerja 09.00 s/d 18.00 Waktu Indonesia Barat (WIB) untuk melayani Pengguna dalam Layanan yang diberikan melalui Platform.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;16. Hukum yang Berlaku&lt;/p&gt;&lt;p&gt;Syarat dan Ketentuan Umum ini dan ketentuan lain yang ditetapkan oleh Perusahaan diatur oleh dan ditafsirkan sesuai dengan hukum Republik Indonesia. Anda sepakat bahwa tindakan hukum apapun atau sengketa yang mungkin timbul dari, berhubungan dengan, penggunaan Platform akan diselesaikan secara eksklusif dalam yurisdiksi Pengadilan Negeri Jakarta Selatan Republik Indonesia.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;', NULL, '2018-07-03 00:00:00', '2018-07-05 10:58:16', '1');
INSERT INTO `mod_pages` (`p_id`, `p_title`, `p_subtitle`, `p_slug`, `p_summary`, `p_content`, `p_images`, `p_created_date`, `p_modified_date`, `p_status`) VALUES
(13, 'Kebijakan Privasi', 'Kebijakan platform BKDana', 'kebijakan-privasi', '', '<br><br>\r\n<p>Kebijakan Privasi ini berlaku untuk BKDana, www.BKDana.id dan dioperasikan oleh PT BERKAH KELOLA DANA. Kebijakan privasi ini menjelaskan bagaimana BKDana mengumpulkan dan menggunakan data pribadi yang telah Anda kirimkan kepada kami.</p>\r\n\r\n<p>Privasi anda dan perlindungan terhadap informasi personal anda yang sensitif sangatlah penting bagi kami. Karena kami mengumpulkan dan/atau menyimpan beberapa jenis informasi dari dan tentang anda, kami perlu menjelaskan kebijakan kami dan syarat dan kondisi seputar pendataan dan penggunaan informasi tersebut.</p>\r\n\r\n<p>Perilaku Pegawai</p>\r\n<p>BKDana menerapkan komitmen penuh kepada integritas dan nilai-nilai perusahaan dan etika standard serta perilaku bisnis yang juga dituntut dari semua pegawai kami.</p>\r\n\r\n<p>Kode Etik BKDana mengatur tata cara mengenai pengamanan informasi rahasia secara spesifik, termasuk di dalamnya informasi pelanggan. Secara umum, pedoman ini membatasi akses pegawai terhadap informasi rahasia dan membatasi penggunaan dan pengungkapan informasi terutama mengenai transaksi dan proses yang telah disetujui dan sedang berjalan. Jika kami mengetahui ada karyawan yang melanggar Kode Etik, tindakan korektif dapat diambil oleh perusahaan, termasuk pemecatan.</p>\r\n\r\n<p>Verifikasi Praktisi Data</p>\r\n<p>Secara berkala, kegiatan dan praktek usaha kami akan ditelaah untuk memeriksa apakah sudah sesuai dengan prosedur dan kebijakan yang mengatur kerahasiaan informasi. Pemeriksaan ini dapat dilakukan oleh staf internal kami sendiri, jasa akuntan dan audit eksternal, dan pemerintah. Termasuk di dalamnya adalah penilaian terhadap perlindungan konsumen terkait dengan privasi.</p>\r\n\r\n<br><br>\r\n<h2>APA YANG BKDana LAKUKAN DENGAN INFORMASI PRIBADI ANDA?</h2>\r\n<p>Apa?</p>\r\n<p>Kami mengumpulkan informasi finansial dan pribadi dari anda sewaktu Anda menggunakan laman kami dan sebagian besar informasi didapatkan sewaktu Anda mendaftar dan mengunggah data anda. Kami juga mengumpulkan data dari akun media sosial yang Anda ijinkan untuk kami akses.</p>\r\n\r\n<p>Kami juga memperoleh data dari waktu Anda berada di laman kami. Data-data ini mencakup, namun tidak terbatas pada, komputer anda, informasi geografis, alamat IP, sumber rujukan, lama waktu anda di laman, periode kunjungan, page views dan klik. Kumpulan informasi ini sebagian besar digunakan untuk meningkatkan kinerja dan keamanan Platform.</p>\r\n\r\n<p>Alasannya?</p>\r\n<p>Kami mewajibkan semua pengguna untuk mengirimkan informasi dasar untuk memudahkan proses verifikasi identitas anda yang telah diatur oleh hukum negara, berkomunikasi anda, memastikan bahwa anda sudah berusia di usia legal dan mengurangi potensi untuk penipuan. Kami hanya akan menggunakan informasi pribadi untuk memberikan layanan kepada pengguna dan tidak akan berbagi data tersebut kepada pihak ketiga tanpa persetujuan dari pengguna kami.</p>\r\n\r\n<p>Kami meminta data tambahan opsional tetapi harus diisi untuk memungkinkan kami untuk memberikan layanan tambahan kepada pengguna. Hal ini termasuk menentukan kelayakan Penerima Pinjaman atas aplikasi pinjamannya melalui proses credit-scoring kami, membuat komunitas berbasis pengguna di platform kami dan melaksanakan kegiatan pengumpulan data yang diperlukan.</p>\r\n\r\n<br><br>\r\n<h2>APAKAH DATA SAYA AMAN?</h2>\r\n\r\n<p>Akses</p>\r\n<p>BKDana sangat berhati-hati dalam praktek bisnis kami agar data yang Anda kirimkan kepada kami aman. Hanya sejumlah staf kami yang memiliki akses ke data pengguna dan sebagian besar dari mereka hanya memiliki akses ke bagian tertentu dari data yang diperlukan untuk melakukan tugas-tugas mereka sebagai bagian dari layanan kami. Staf Kami tidak diperbolehkan untuk mentransfer atau membawa keluar data dari server kami.</p>\r\n\r\n<p>Penyimpanan</p>\r\n<p>Kami berkonsultasi dengan penyedia jasa keamanan finansial dan memberlakukan teknis perlindungan seperti enkripsi, dua faktor otentifikasi, dan pemantauan berkala untuk memastikan bahwa informasi Anda dilindungi dan bahwa ada perlindungan untuk melindungi kepentingan para pengguna kami.</p>\r\n\r\n<p>Ulasan</p>\r\n<p>Langkah-langkah ini akan ditinjau dan disesuaikan secara berkala berdasarkan penilaian risiko yang sedang berlangsung atau pelanggaran keamanan, karena belum ada lembaga yang dapat menjamin sistem yang benar-benar aman. Kami juga merekomendasikan pengguna untuk mengambil langkah-langkah tertentu untuk membantu melindungi informasi mereka.</p>\r\n\r\n<p>Berbagi</p>\r\n<p>Pengguna dapat memilih untuk menambahkan pengguna lain ke daftar kontak mereka, atau membentuk dan bergabung di dalam kelompok dengan pengguna lain untuk mengidentifikasi dan merasa nyaman serta aman. Hal tersebut, dapat memungkinkan pengguna memperbolehkan beberapa informasi dari masing-masing untuk dilihat oleh anggota kelompok dan daftar kontak.</p>\r\n\r\n<p>Notifikasi</p>\r\n<p>Kami dapat mengirimkan notifikasi dari waktu ke waktu. Ini hal yang diperlukan bagi transaksi Anda pada platform kami dan juga konfirmasi yang diperlukan atas tindakan yang telah diambil. Hal ini untuk memastikan bahwa tidak ada orang lain yang membuat perubahan ke akun Anda tanpa sepengetahuan Anda.</p>\r\n\r\n<p>Kami juga akan mengirimkan update berkala pada akun Anda selama periode tertentu. Terkadang kami juga bisa mengirimkan pesan tentang update di platform kami yang mungkin adalah promosi atau perubahan di platform kami yang akan berpengaruh terhadap pengguna kami.</p>\r\n\r\n<p>Kasus situasional</p>\r\n<p>Dalam kasus dari proses hukum, perintah pengadilan, atau proses, kami mungkin membagi data relevan kepada penegak hukum atau badan pemerintah seperti yang disyaratkan oleh hukum. Kami juga dapat membagi catatan pinjaman dan Penerima Pinjaman serta segala jenis pembayaran yang terrekam sistem Bank Sentral BI terutama dalam hal gagal pinjam.</p>\r\n\r\n<p>Perubahan Kebijakan Privasi</p>\r\n<p>Karena perusahaan dan platform kami berevolusi untuk melayani pengguna kami dengan lebih baik, oleh karenanya kami terkadang membuat perubahan terhadap Kebijakan Privasi ini untuk kebutuhan yang memang diperlukan. Dalam hal perubahan substantif atau materiil, kami akan memberitahu Anda sebelum perubahan tersebut menjadi efektif.</p>', NULL, '2018-07-03 00:00:00', '0000-00-00 00:00:00', 'active');
