INSERT INTO `mod_setting_home` (`setting_home_id`, `home_1`, `home_2`, `home_3`, `home_4`, `home_5`, `home_6`, `home_7`, `home_8`, `home_9`, `home_10`, `home_11`, `home_12`, `home_13`, `home_14`, `home_15`) VALUES
(1, '&lt;h3&gt;Akses di multi perangkat&lt;/h3&gt;\r\n\r\n&lt;p&gt;BKDana hadir di multi platform, baik di Web, Android dan iOS, memudahkan transaksi dimanapun dan kapanpun.&lt;/p&gt;', '&lt;h3&gt;Penggunaan Mudah &amp;amp; Aman&lt;/h3&gt;\r\n\r\n&lt;p&gt;Platform BKDana sangat mudah digunakan dan diawasi oleh OJK&lt;/p&gt;', '&lt;h3&gt;Risiko Terukur &amp;amp; Transparan&lt;/h3&gt;\r\n\r\n&lt;p&gt;BKDana hanya menyalurkan kredit ke pemijam yang tervirifikasi dan dilengkapi analisa credit scoring melalui jejak digital terpercaya.&lt;/p&gt;', '&lt;h3&gt;Pinjaman yang Tersalurkan&lt;/h3&gt;\r\n\r\n&lt;p&gt;11,000,000,000 IDR&lt;/p&gt;', '&lt;h3&gt;Investasi tumbuh cepat&lt;/h3&gt;\r\n\r\n&lt;p&gt;Bunga investasi jauh diatas bunga deposito dan besarnya tergantung sektor usaha dan rating peminjam&lt;/p&gt;', '&lt;h3&gt;Investasi telah dikucurkan kepada lebih dari&lt;/h3&gt;\r\n\r\n&lt;p&gt;8,000 UMKM&lt;/p&gt;', '&lt;h2&gt;Siapa Kami (BKDana)&lt;/h2&gt;\r\n\r\n&lt;p&gt;PT BERKAH KELOLA DANA adalah perusahaan yang mengelola platform layanan pinjam meminjam uang berbasis teknologi, khususnya fasilotator untuk mempertemukan pihak yang sedang membutuhkan pendanaan dan pihak yang bersedia memberi pinjaman.&lt;/p&gt;\r\n\r\n&lt;p&gt;Platform kami berbasis web dan mobile apps yang bisa diakses oleh pemberi pinjaman secara global baik dalam dan luar negeri, yang akan membantu permodalan bagi perorangan maupun Usaha Mikro, Kecil dan Menengah (UMKM) di seluruh wilayah Indonesia.&lt;/p&gt;', '&lt;ul&gt;\r\n	&lt;li&gt;Pinjaman : 249,000,000 IDR&lt;/li&gt;\r\n	&lt;li&gt;Pengembalian : 278,000,000 IDR&lt;/li&gt;\r\n	&lt;li&gt;Tenor : 76 hari&lt;/li&gt;\r\n	&lt;li&gt;Lokasi : Jakarta&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;div&gt;PT. Sarimelati Kencana\r\n&lt;div&gt;&lt;em&gt;Industri Makanan &amp;amp; Masakan Olahan&lt;/em&gt;&lt;/div&gt;\r\n&lt;/div&gt;', '&lt;ul&gt;\r\n	&lt;li&gt;Pinjaman : 48,000,000 IDR&lt;/li&gt;\r\n	&lt;li&gt;Pengembalian : 75,000,000 IDR&lt;/li&gt;\r\n	&lt;li&gt;Tenor : 112 hari&lt;/li&gt;\r\n	&lt;li&gt;Lokasi : Bandung&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;div&gt;PT. Jatrindo Antaransentra\r\n&lt;div&gt;&lt;em&gt;Angkutan Laut Domestik&lt;/em&gt;&lt;/div&gt;\r\n&lt;/div&gt;', '&lt;ul class=&quot;product&quot;&gt;\r\n                                    &lt;li&gt;Pinjaman : 2,000,000 IDR&lt;/li&gt;\r\n                                    &lt;li&gt;Pengembalian : 2,500,000 IDR&lt;/li&gt;\r\n                                    &lt;li&gt;Tenor : 14 hari&lt;/li&gt;\r\n                                    &lt;li&gt;Lokasi : Jakarta&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                                &lt;div class=&quot;description&quot;&gt;\r\n                                    CV. TPI\r\n                                    &lt;div&gt;&lt;i&gt;Online Seller Financing&lt;/i&gt;&lt;/div&gt;\r\n                                &lt;/div&gt;', '&lt;ul class=&quot;product&quot;&gt;\r\n                                    &lt;li&gt;Pinjaman : 249,000,000 IDR&lt;/li&gt;\r\n                                    &lt;li&gt;Pengembalian : 278,000,000 IDR&lt;/li&gt;\r\n                                    &lt;li&gt;Tenor : 76 hari&lt;/li&gt;\r\n                                    &lt;li&gt;Lokasi : Jakarta&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                                &lt;div class=&quot;description&quot;&gt;\r\n                                    PT. Sarimelati Kencana\r\n                                    &lt;div&gt;&lt;i&gt;Industri Makanan &amp;amp; Masakan Olahan&lt;/i&gt;&lt;/div&gt;\r\n                                &lt;/div&gt;', '&lt;ul class=&quot;product&quot;&gt;\r\n                                    &lt;li&gt;Pinjaman : 48,000,000 IDR&lt;/li&gt;\r\n                                    &lt;li&gt;Pengembalian : 75,000,000 IDR&lt;/li&gt;\r\n                                    &lt;li&gt;Tenor : 112 hari&lt;/li&gt;\r\n                                    &lt;li&gt;Lokasi : Bandung&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                                &lt;div class=&quot;description&quot;&gt;\r\n                                    PT. Jatrindo Antaransentra\r\n                                    &lt;div&gt;&lt;i&gt;Angkutan Laut Domestik&lt;/i&gt;&lt;/div&gt;\r\n                                &lt;/div&gt;', '&lt;ul class=&quot;product&quot;&gt;\r\n                                    &lt;li&gt;Pinjaman : 200,000,000 IDR&lt;/li&gt;\r\n                                    &lt;li&gt;Pengembalian : 245,000,000 IDR&lt;/li&gt;\r\n                                    &lt;li&gt;Tenor : 132 hari&lt;/li&gt;\r\n                                    &lt;li&gt;Lokasi : Jakarta&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                                &lt;div class=&quot;description&quot;&gt;\r\n                                    CV. TPI\r\n                                    &lt;div&gt;&lt;i&gt;Online Seller Financing&lt;/i&gt;&lt;/div&gt;\r\n                                &lt;/div&gt;', '&lt;div&gt;\r\n&lt;div&gt;\r\n&lt;h2&gt;Perhatian&lt;/h2&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;BKDana adalah platform Layanan Pinjam Meminjam Uang Berbasis Teknologi Informasi (Fintech Lending) yang hanya menfasilitasi bertemunya Pemberi Pinjaman dan Peminjam.&lt;/li&gt;\r\n	&lt;li&gt;Kesepakatan yang ada di BKDana merupakan hubungan dan kesepakatan perdata secara langsung antara Pemberi Pinjaman dengan Penerima Pinjaman, sehingga segala resiko dan akibat hukum daripadanya ditanggung sepenuhnya oleh masingmasing pihak yang berkontrak&lt;/li&gt;\r\n	&lt;li&gt;Apabila terjadi Resiko Kredit atau Gagal Bayar dan seluruh kerugian dari atau terkait dengan kesepakatan pinjam meminjam, akan ditanggung sepenuhnya oleh Pemberi Pinjaman. Tidak ada lembaga atau otoritas negara yang bertanggung jawab atas resiko gagal bayar dan kerugian tersebut&lt;/li&gt;\r\n	&lt;li&gt;Pemberi Pinjaman yang belum memiliki pengetahuan dan pengalaman sebagai pengguna layanan Pinjam-Meminjam atau Fintech lending, disarankan tidak menggunakan layanan ini.&lt;/li&gt;\r\n	&lt;li&gt;Peminjam yang belum pernah memanfaatkan Fintech Lending, wajib mempertimbangkan tingkat bunga pinjaman dan biaya-biaya lainnya sesuai dengan kemampuannya dalam melunasi pinjaman.&lt;/li&gt;\r\n	&lt;li&gt;Setiap bentuk kecurangan akan tercatat secara digital di dunia maya dan dapat diketahui masyarakat luas melalui media social, serta dapat menjadi alat bukti hukum yang sah menurut peraturan mengenai informasi dan transaksi elektronik dalam proses penyelesaian sengketa dan penegakan hukum.&lt;/li&gt;\r\n	&lt;li&gt;Masyarakat Pengguna wajib membaca dan memahami informasi ini secara teliti sebelum mengambil keputusan sebagai Pemberi Pinjaman maupun Penerima Pinjaman.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;', '&lt;p&gt;PT Berkah Kelola Dana (&amp;quot;BKDana&amp;quot;) sedang memproses pendaftaran di Otoritas Jasa Keuangan (&amp;quot;OJK&amp;quot;) sebagai Penyelenggara Layanan Pinjam Meminjam Uang Berbasis Teknologi Informasi dengan Surat Tanda Terima dari OJK Nomor OJK-011249 tanggal 27 Februari 2018 sehingga setelah nanti mendapat status terdaftar maka pelaksanaan kegiatan usaha kami akan diawasi secara ketat oleh OJK berdasarkan Peraturan Otoritas Jasa Keuangan Nomor 77/POJK.01/2016 tentang Layanan Pinjam Meminjam Uang Berbasis Teknologi Informasi.&lt;/p&gt;\r\n\r\n&lt;p&gt;Isi dan materi yang tersedia pada situs bkdana.id dimaksudkan untuk memberikan informasi dan tidak dianggap sebagai sebuah penawaran, permohonan, undangan, saran, maupun rekomendasi untuk menginvestasikan sekuritas, produk pasar modal, atau jasa keuangan lainya. Perusahaan dalam memberikan jasanya hanya terbatas pada fungsi administratif.&lt;/p&gt;\r\n\r\n&lt;p&gt;Pendanaan dan pinjaman yang ditempatkan di rekening BKDana adalah tidak akan dianggap sebagai simpanan yang diselenggarakan oleh Perusahaan seperti diatur dalam Peraturan Perundang-Undangan tentang Perbankan di Indonesia. Perusahaan atau setiap Direktur, Pegawai, Karyawan, Wakil, Afiliasi, atau Agen-Agennya tidak memiliki tanggung jawab terkait dengan setiap gangguan atau masalah yang terjadi atau yang dianggap terjadi yang disebabkan oleh minimnya persiapan atau publikasi dari materi yang tercantum pada situs Perusahaan.&lt;/p&gt;');
